/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `po_hist` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `po_domain` bigint unsigned NOT NULL,
  `po_department` bigint unsigned DEFAULT NULL,
  `po_nbr` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `po_supplier` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `po_currency` varchar(3) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `po_site` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `po_shipto` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `po_taxc` varchar(3) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `po_is_taxable` enum('Yes','No') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'No',
  `po_tax_rate` decimal(8,5) NOT NULL DEFAULT '0.00000',
  `po_ord_date` date NOT NULL,
  `po_need_date` date NOT NULL,
  `po_due_date` date NOT NULL,
  `po_print_status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `po_status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `po_reason` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `po_remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `po_rev` int NOT NULL DEFAULT '0',
  `po_flag_monthly` varchar(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'N',
  `po_sent_flag` varchar(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'N',
  `po_erb` varchar(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT 'N',
  `pr_nbr` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `so_nbr` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `pod_line` int NOT NULL,
  `pod_is_memo` enum('No','Yes') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'No',
  `pod_item_code` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `pod_item_desc` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `pod_um` varchar(2) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `pod_due_date` date DEFAULT NULL,
  `pod_need_date` date DEFAULT NULL,
  `pod_exchange_rate` decimal(13,10) NOT NULL DEFAULT '0.0000000000',
  `pod_taxable` enum('No','Yes') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'No',
  `pod_tax_class` varchar(3) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `pod_cr_terms` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `pod_qty_ord` decimal(8,2) NOT NULL,
  `pod_qty_open` decimal(8,2) NOT NULL,
  `pod_pur_cost` decimal(14,2) NOT NULL,
  `pod_discount` decimal(5,2) NOT NULL DEFAULT '0.00',
  `pod_pr_nbr` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `pod_account` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `pod_sub_acc` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
