  `pod_project` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `pod_deleted` enum('Yes','No') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'No',
  `created_by` bigint unsigned NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `pod_total_cost_det` decimal(14,2) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `po_hist_po_domain_index` (`po_domain`),
  KEY `po_hist_po_department_index` (`po_department`),
