CREATE TABLE `stock_request_hist` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `srm_nbr` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `srm_domain_id` bigint unsigned NOT NULL,
