  `srm_eff_date` date DEFAULT NULL,
  `srm_summary_cost` decimal(15,2) NOT NULL DEFAULT '0.00',
  `srm_remark` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `srm_reason` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `srm_status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'New',
  `srd_item_code` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `srd_item_desc` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `srd_qty_request` decimal(15,2) NOT NULL,
  `srd_qty_pick` decimal(15,2) NOT NULL DEFAULT '0.00',
  `srd_site` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `srd_loc` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `srd_lot` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `srd_cost` decimal(15,2) NOT NULL DEFAULT '0.00',
  `srd_total_cost` decimal(15,2) NOT NULL DEFAULT '0.00',
  `srd_account` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `srd_sub_account` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `srd_cost_center` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `srd_project` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `srd_img_link` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `srd_status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `srd_action` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_by` bigint unsigned NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `stock_request_hist_srm_nbr_index` (`srm_nbr`),
  KEY `stock_request_hist_srm_domain_id_index` (`srm_domain_id`),
  KEY `stock_request_hist_srm_department_id_index` (`srm_department_id`),
  KEY `stock_request_hist_created_by_index` (`created_by`),
  CONSTRAINT `stock_request_hist_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`) ON DELETE RESTRICT,
  CONSTRAINT `stock_request_hist_srm_department_id_foreign` FOREIGN KEY (`srm_department_id`) REFERENCES `departments` (`id`) ON DELETE RESTRICT,
  CONSTRAINT `stock_request_hist_srm_domain_id_foreign` FOREIGN KEY (`srm_domain_id`) REFERENCES `domains` (`id`) ON DELETE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=218 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
